import React, { useState } from "react";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import HighlightOffIcon from "@mui/icons-material/HighlightOff";
import "./Shifter.css";

const Shifter = (props) => {

  const [shifters, setShifters] = useState(props.data);
  const [curentShifterId, setCurentShifterId] = useState(0);

  const deleteItemHandler = () => {
    console.log(curentShifterId);
  };

  return (
    <div>
      {props.data.map((shifter) => {
        const shifterId = shifter.id;
        const shifterTime = shifter.time;
        const shifterName = shifter.employee;
        setCurentShifterId(shifterId);
        return (
          <Grid
            container
            direction="row"
            justifyContent="space-between"
            alignItems="center"
            className="myBorder"
          >
            <Grid item>
              <Typography variant="h6">
                {shifterTime} <span>&nbsp;&nbsp;&nbsp;</span> {shifterName}
              </Typography>
            </Grid>
            <Grid item>
              <HighlightOffIcon fontSize="medium" onClick={deleteItemHandler}/>
            </Grid>
          </Grid>
        );
      })}
    </div>
  );
};
export default Shifter;
